import React, {useState, useEffect, useRef} from 'react';
//import {ReactFullpage as fullpage} from '@fullpage/react-fullpage';
import {SectionsContainer, Section} from 'react-fullpage';

import './App.css'
import Navigation from './components/Navigation/Navigation.js'
import About from './components/About/About.js'
import Services from './components/Services/Services.js'
import Realizations from './components/Realizations/Realizations.js'
import Contact from './components/Contact/Contact.js'

function App() {

  let options = {
    sectionClassName:     '.main__wrapper',
    anchors:              ['About', 'Services', 'Realiations', 'Contact'],
    navigationTooltips:   ['About', 'Services', 'Realiations', 'Contact'],
    scrollBar:            false,
    navigation:           true,
    verticalAlign:        false,
    sectionPaddingTop:    '50px',
    sectionPaddingBottom: '50px',
    arrowNavigation:      true,
    autoScrolling: true
  };


  return (

    <div className="main__wrapper">
        <SectionsContainer {...options}>
            <About/>
            <Services/>
            <Realizations/>
            <Contact/>
        </SectionsContainer>
    </div> 

  );
}

export default App;
